import axios from "axios";

const rootURL = "http://localhost:7071/users/";

let testUrl = () => {
    try{
        let pobj = axios.get(rootURL);
        return pobj;
    }
    catch(exception){
        console.log(rootURL + ": not correct " + (exception));
    }
}

let logIn = (username, password) => {
    try{
        let pobj = axios.get(rootURL + "logIn?userName="+username+"&password="+password);

        /*pobj.then((response) => {
            console.log(JSON.stringify(response.data, null, 3));
        });*/

        return pobj;
    }
    catch(exception){
        console.log(rootURL + "login?userName="+username+"&password="+password+": not correct " + (exception));
    }
}

export { testUrl, logIn };
